import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TokenVesting is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    struct VestingSchedule {
        uint256 startTime;
        uint256 cliff;
        uint256 duration;
        uint256 amount;
        uint256 released;
    }

    IERC20 public token;
    mapping(address => VestingSchedule) public vestingSchedules;

    event VestingScheduleCreated(
        address beneficiary,
        uint256 startTime,
        uint256 cliff,
        uint256 duration,
        uint256 amount
    );
    event TokensReleased(address beneficiary, uint256 amount);

    constructor(IERC20 _token) {
        token = _token;
    }

    function createVestingSchedule(
        address beneficiary,
        uint256 startTime,
        uint256 cliff,
        uint256 duration,
        uint256 amount
    ) external onlyOwner {
        require(beneficiary != address(0), "Beneficiary cannot be zero address");
        require(cliff <= duration, "Cliff must be less than or equal to duration");
        require(amount > 0, "Amount must be greater than 0");

        vestingSchedules[beneficiary] = VestingSchedule({
            startTime: startTime,
            cliff: cliff,
            duration: duration,
            amount: amount,
            released: 0
        });

        emit VestingScheduleCreated(beneficiary, startTime, cliff, duration, amount);
    }

    function release(address beneficiary) external {
        VestingSchedule storage schedule = vestingSchedules[beneficiary];
        require(schedule.amount > 0, "No vesting schedule found");

        uint256 unreleased = releasableAmount(beneficiary);
        require(unreleased > 0, "No tokens to release");

        schedule.released = schedule.released.add(unreleased);
        token.safeTransfer(beneficiary, unreleased);

        emit TokensReleased(beneficiary, unreleased);
    }

    function releasableAmount(address beneficiary) public view returns (uint256) {
        VestingSchedule storage schedule = vestingSchedules[beneficiary];
        return vestedAmount(beneficiary).sub(schedule.released);
    }

    function vestedAmount(address beneficiary) public view returns (uint256) {
        VestingSchedule storage schedule = vestingSchedules[beneficiary];
        uint256 currentTime = block.timestamp;

        if (currentTime < schedule.startTime.add(schedule.cliff)) {
            return 0;
        } else if (currentTime >= schedule.startTime.add(schedule.duration)) {
            return schedule.amount;
        } else {
            uint256 timeElapsed = currentTime.sub(schedule.startTime);
            return schedule.amount.mul(timeElapsed).div(schedule.duration);
        }
    }
}
